import React from 'react';
import { Divider, Header } from 'semantic-ui-react';

class Portfolio extends React.Component {
  render(){
    return (
      <div className='portfolio'>
        <Header as='h2' disable={true}> </Header>
        Portfolio.
      </div>
    )
  };
};

export default Portfolio;
